        search() {
            if (this.file == '' && this.scsa_form.scsa_master == '' && this.scsa_masters_type == '') {
                this.$message.warning('Please input or select a file！')
                return
            }
            this.loading = true
            let formData = new FormData()
            formData.append('species_type', this.scsa_form.species)
            formData.append('marker_resource', this.scsa_form.marker_resource)
            formData.append('tissue_type', this.scsa_form.tissue)
            formData.append('file', this.file)
            formData.append('scsa_master', this.scsa_form.scsa_master)
            formData.append('scsa_masters_type', this.scsa_masters_type)
            let config = {
                headers: {
                    'Content-Type': 'multipart/form-data'
                }
            }
            sessionStorage.removeItem('scsa')
            const $axios = Axios.create({
                baseURL: axios.defaults.baseURL,
                timeout: 100000
            })

            $axios
                .post('api/v1/cell_scsa_master_map/', formData, config)
                .then((res) => {
                    if (res.data.code == 200) {
                        sessionStorage.setItem('scsa', JSON.stringify(res.data.data))
                        this.loading = false
                        this.$router.push('/scsaDetails')
                    } else {
                        this.$message.warning(res.data.msg)
                    }
                })
                .catch((err) => {
                    this.$message.warning(err.data.msg)
                })
        },
        reset() {
            this.fileName = ''
            this.file = ''
            this.scsa_form = {
                scsa_master: '',
                marker_resource: 'all',
                species: 'Arabidopsis_thaliana',
                tissue: ''
            }
            this.scsa_masters_type = ''
            this.loading = false
            this.$refs['form1'].resetFields()
        },
        handleUpdate(event) {
            if (event.target.files[0].name.split('.')[event.target.files[0].name.split('.').length - 1] != 'csv') {
                this.$message.warning('Please upload .csv file！')
            } else {
                this.scsa_masters_type = ''
                this.fileName = event.target.files[0].name
                this.file = event.target.files[0]
                sessionStorage.setItem('files', JSON.stringify(event.target.files[0]))
            }
        },
        download() {
            this.jg_downloadFile('api/v1/cell_scsa_master_map/scsa_master_download', { name: 'scsa_master.csv' })
        }
    }
